    return ( 
        <>
        
        <nav className="navbar navbar-expand-md navbar-dark">
            <h3 className=" name ml-2">Hannan Rajput</h3> <h1 className="coma">.</h1>
            <button class="navbar-toggler" type="button" data-target="#ha" data-toggle="collapse">
                <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse" id="ha">
             <ul className="navbar-nav mx-auto">
                    {/* <a href="" className="nav-link bar" style={{color:"white"}}><li className="nav-item">HOME</li></a>
                    <a href="" className="nav-link bar" style={{color:"white"}}><li className="nav-item">ABOUT</li></a>
                    <a href="" className="nav-link bar" style={{color:"white"}}><li className="nav-item">RESUME</li></a>
                    <a href="" className="nav-link bar" style={{color:"white"}}><li className="nav-item">SERVICES</li></a>
                    <a href="" className="nav-link bar" style={{color:"white"}}><li className="nav-item">PROJECTS</li></a>
                    <a href="" className="nav-link bar" style={{color:"white"}}><li className="nav-item">CONTACT</li></a> */}

                    <Link to="home"><li className="nav-item">HOME</li></Link>
                    <Link to="home"><li className="nav-item">About</li></Link>
                    <Link to="home"><li className="nav-item">Services</li></Link>
                    <Link to="home"><li className="nav-item">Resume</li></Link>
                    <Link to="home"><li className="nav-item">H</li></Link>
                    <Link to="home"><li className="nav-item">HOME</li></Link>
                    
                    
                </ul>
                </div>
        </nav>
        
            
        
    
    </>
     );
}
 
export default Navbar;
